  const [searchTerm, setSearchTerm] = useState('')
  const getSearchValue=(value)=>{setSearchTerm(value)}
  console.log(searchTerm)

  return (
    <>
      <Header/>
      <SearchBar getSearchValue={getSearchValue}/>
      <Routes>
        <Route path="/" element={<Main searchTerm={searchTerm}/>}></Route>
      </Routes>

    </>
  );
}

export default App;
